    //                         <div className="absolute top-full right-0 bg-white p-2 border rounded shadow-md w-64">
    //                             <ul>
    //                                 <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/profile">Profile</Link></li>
    //                                 <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/my-bookings">My Bookings</Link></li>
    //                                 <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/cancel-tickets">Cancel Tickets</Link></li>
    //                                 <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><Link to="/show-my-ticket">Show My Ticket</Link></li>
    //                                 <li className="py-2 px-4 hover:bg-gray-200 rounded-md"><button onClick={handleSignOut}>Sign Out</button></li>
    //                             </ul>
    //                         </div>
    //                     )}
    //                 </div>
    //             </div>
    //         );
    //     } else {
    //         return (
    //             <div className="flex-item">
    //                 <Link to="/sign-in" className="border-1-custom py-2 px-4 rounded-md transition-all duration-300 hover:bg-gray-300">Sign In or Register</Link>
    //             </div>
    //         );
    //     }
    // };

    return (
        <div className='webnav_area w-full py-4'>
            <div className="max-w-6xl w-full px-4 lg:px-0 mx-auto">
                <div className="flex items-center justify-between flex-wrap font-bold">
                    <div className="flex-item">
                        <Link to="/">
                            <h2 className='text-3xl font-extrabold inline'>
                                <img src={logo} className="w-12 inline mr-1" alt="bus" />
                                <code id="heading"> FatafAT yAtra </code>
                            </h2>
                        </Link>
                    </div>

                    {/* <div className="flex items-center space-x-3"> */}

                    <div className="flex-item hidden lg:block">
                        <Link to="/busses" className='mr-3 border-1-custom py-2 px-4 rounded-full transition-all duration-300 hover:bg-gray-300'>
                            <img src={Bus} className="w-5 inline mr-1" alt="bus" />
                            <span>Buses</span>
                        </Link>
                    </div>
                    <div className="flex items-center relative">
                        <div className="cursor-pointer flex items-center" onClick={() => { handleMenu() }}>
                            <span className="mr-2">Account</span>
                            {arrow === 'down' ? (
                                <svg height="24" style={arrowCol} id="dropdown-arrow" viewBox="0 0 24 24" width="24" xmlns="http://www.w3.org/2000/svg"><path d="M11.178 19.569a.998.998 0 0 0 1.644 0l9-13A.999.999 0 0 0 21 5H3a1.002 1.002 0 0 0-.822 1.569l9 13z" /></svg>
