                                <svg height="24" style={arrowCol} id="dropdown-arrow" viewBox="0 0 24 24" width="24" xmlns="http://www.w3.org/2000/svg"><path d="M3 19h18a1.002 1.002 0 0 0 .823-1.569l-9-13c-.373-.539-1.271-.539-1.645 0l-9 13A.999.999 0 0 0 3 19z" /></svg>
                            )}
                        </div>
                        {expandNav && (
                            <div id="dropdown" className="absolute top-full right-0 mt-2 p-2 border rounded shadow-md w-64" style={{zIndex:1000}}>
                                <ul>
                                    <li className="py-2 px-4 hover:bg-gray-200 rounded-md text-center"><Link to="/profile">Profile</Link></li>
                                    <li className="py-2 px-4 hover:bg-gray-200 rounded-md text-center"><Link to="/my-bookings">My Bookings</Link></li>
                                    <li className="py-2 px-4 hover:bg-gray-200 rounded-md text-center"><Link to="/cancel-tickets">Cancel Tickets</Link></li>
                                    <li className="py-2 px-4 hover:bg-gray-200 rounded-md text-center"><Link to="/show-my-ticket">Show My Ticket</Link></li>
                                    <li className="py-2 px-4 hover:bg-gray-200 rounded-md text-center"><button onClick={handleSignOut}>Sign Out</button></li>
                                </ul>
                            </div>
                        )}
                    </div>

                    {/* </div> */}
                </div>
            </div>
        </div>
    );
};

export default WebNav;
